import { Link } from "react-router-dom";
import UserDetails from "../screens/UserDetails";

import "../style/components/User.css";

const User = ({ name, username, website, id }) => {
  const userUrl = `/users/${id}`;

  return (
    <div className="user-card">
      {/* <img className="user-img"></img> */}
      <h1>{name}</h1>
      <h3>@{username}</h3>
      <a href={website}>http://{website}</a>
      <Link to={userUrl} className="user-link">
        <UserDetails />
      </Link>
    </div>
  );
};

export default User;
